import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Root from './Root'
import Strong from "./screens/Templates/Icon/Strong";
import ABCDE from "./screens/Templates/ABCDE/ABCDE";
import ABCD from "./screens/Templates/ABCD/ABCD";
import ABCDE_OneColumn from "./screens/Templates/ABCDE_OneColumn/ABCDE_OneColumn";
import ABCD_OneColumn from "./screens/Templates/ABCD_OneColumn/ABCD_OneColumn";
import DoubleOpen from "./screens/Templates/Double_Open/Double_Open";
import DoubleOpenOneColumn from "./screens/Templates/Double_Open_OneColumn/Double_Open_OneColumn";
import Open from "./screens/Templates/Open/Open";
import SuperOpen from "./screens/Templates/Super_Open/Super_Open";
import Logic_couples_4_4 from "./screens/Templates/Logic_Couples/Logic_couples_4_4";
import Logic_couples_4_5 from "./screens/Templates/Logic_Couples/Logic_couples_4_5";
import Logic_Couples_4_4_OneColumn from "./screens/Templates/Logic_Couples_OneColumn/Logic_Couples_4_4_OneColumn";
import Logic_Couples_4_5_OneColumn from "./screens/Templates/Logic_Couples_OneColumn/Logic_Couples_4_5_OneColumn";
import ResponsiveScreen from "./screens/Ekran";



ReactDOM.render(
    <div>
        <ResponsiveScreen/>
        <Root/>
    </div>,
  document.getElementById('root')
);

serviceWorker.unregister();
